import Select from "react-select";
import React, { Component } from "react";

class listadd extends Component{

    render(){

        const Options = [
            {
              id: "role",
              label: 'Superusuario',
              value: 'Superusuario',
            },
            {
              id: "role",
              label: 'Contador',
              value: 'Contador',
            },
            {
              id: "role",
              label: 'Operario',
              value: 'Operario',
            },
        ];

        return (
            <Select 
                options = {Options}
            />
        )

          
    }

}

export default listadd;
